import React from 'react'
import { Link } from 'react-router-dom';
import image from '../../../src/fotos/dog.png'
import style from ''

const LandingPage = () => {
    
    return (
            <div className="landingWrapper">
                <p>Let's Go!</p>
                <Link className="landingButton" to="/home">
                    <button>Home</button>
                </Link>
            <img src={image} alt="Imagen de un perro"/>
        </div>
    );

};

export default LandingPage;
